// SPDX-License-Identifier: MIT

pragma solidity ^0.6.0;

import "./interfaces/IBEP20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./lib/TransferHelper.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract Refund is Ownable, ReentrancyGuard {
    using SafeMath for uint256;

    address public token;

    uint256 public TOTAL_FUND = 682_240_887_171_000_000_000;

    struct UserInfo {
        uint256 fund; // user's volume
        bool refundable; // Last transaction block
    }

    mapping(address => UserInfo) public userInfo;
    mapping(address => bool) public userExists;

    uint256 public totalFund;

    event AddUser(address _user, uint256 _fund, uint256 _totalFund);

    constructor(address _owner, address _token) public {
        require(_owner != address(0), "_owner can't be 0 address");
        require(_token != address(0), "_token can't be 0 address");
        token = _token;
        transferOwnership(_owner);
    }

    function add(address _user, uint256 _fund) external onlyOwner {
        require(_user != address(0), "_user can't be 0 address");
        require(_fund != 0, "_fund can't be 0 address");
        require(!userExists[_user], "_user exsits.");
        userExists[_user] = true;
        uint256 _totalFund = totalFund.add(_fund);
        require(_totalFund <= TOTAL_FUND, "user is full for refund.");
        userInfo[_user].fund = _fund;
        userInfo[_user].refundable = true;
        totalFund = _totalFund;
        emit AddUser(_user, _fund, _totalFund);
    }

    function fillFunds(uint256 _fund) external {
        uint256 _bal = IBEP20(token).balanceOf(address(this)).add(_fund);
        require(TOTAL_FUND == _bal, "more or less then TOTAL_FUND");
        TransferHelper.safeTransferFrom(
            token,
            msg.sender,
            address(this),
            _fund
        );
    }

    function withdraw() external nonReentrant {
        require(userExists[msg.sender], "user no exists.");
        UserInfo storage _user = userInfo[msg.sender];
        require(_user.refundable, "_user can't refund.");
        _user.refundable = false;
        uint256 bal = IBEP20(token).balanceOf(address(this));
        require(bal >= _user.fund, "insufficient funds.");
        TransferHelper.safeTransfer(token, msg.sender, _user.fund);
    }

    function withdrawAll() external onlyOwner {
        uint256 bal = IBEP20(token).balanceOf(address(this));
        TransferHelper.safeTransfer(token, msg.sender, bal);
    }
}
